func TestGenerateExcelMappingCluster(t *testing.T) {

	recordNotFoundError := errors.New(constant.RECORD_NOT_FOUND)
	upstreamError := errors.New(constant.ERROR_UPSTREAM + " - Get mapping cluster branch error")

	testCases := []struct {
		name           string
		mockReturnData []entity.InquiryMappingCluster
		mockReturnErr  error
		expectError    bool
		errorMessage   string
	}{
		{
			name: "success",
			mockReturnData: []entity.InquiryMappingCluster{
				{
					BranchID:       "400",
					BranchName:     "BEKASI",
					CustomerStatus: "AO/RO",
					BpkbNameType:   1,
					Cluster:        "Cluster A",
				},
			},
			mockReturnErr: nil,
			expectError:   false,
		},
		{
			name:          "error repository",
			mockReturnErr: upstreamError,
			expectError:   true,
			errorMessage:  upstreamError.Error(),
		},
		{
			name:          "error not found",
			mockReturnErr: recordNotFoundError,
			expectError:   false,
		},
	}

	for _, tc := range testCases {
		t.Run(tc.name, func(t *testing.T) {
			mockRepository := new(mocks.Repository)
			mockHttpClient := new(httpclient.MockHttpClient)
			var cache *bigcache.BigCache

			mockRepository.On("GetInquiryMappingCluster", mock.Anything, mock.Anything).Return(tc.mockReturnData, len(tc.mockReturnData), tc.mockReturnErr)

			usecase := NewUsecase(mockRepository, mockHttpClient, cache)

			genName, fileName, err := usecase.GenerateExcelMappingCluster()

			if tc.expectError {
				assert.Error(t, err)
				if tc.errorMessage != "" {
					assert.EqualError(t, err, tc.errorMessage)
				}
			} else {
				assert.NoError(t, err)
				assert.NotEmpty(t, genName)
				assert.True(t, strings.HasPrefix(fileName, "MappingCluster_"))

				_, err := os.Stat("./" + genName + ".xlsx")
				assert.NoError(t, err)

				os.Remove("./" + genName + ".xlsx")
			}
		})
	}
}

type bytesCloser struct {
	*bytes.Reader
}

func (bc bytesCloser) Close() error {
	return nil
}

func newBytesCloser(b []byte) *bytesCloser {
	return &bytesCloser{
		Reader: bytes.NewReader(b),
	}
}

