func TestGetMappingClusterBranch(t *testing.T) {
	testcases := []struct {
		name          string
		req           request.ReqListMappingClusterBranch
		expectedData  []entity.ConfinsBranch
		mockError     error
		expectedError error
	}{
		{
			name: "error repository",
			req: request.ReqListMappingClusterBranch{
				BranchID: "400",
			},
			mockError:     errors.New("upstream_service_error - Get Mapping Cluster Branch"),
			expectedError: errors.New("upstream_service_error - Get Mapping Cluster Branch"),
		},
		{
			name: "success",
			req: request.ReqListMappingClusterBranch{
				BranchID: "400",
			},
			expectedData: []entity.ConfinsBranch{
				{
					BranchID:   "400",
					BranchName: "BEKASI",
				},
			},
		},
	}

	for _, tc := range testcases {
		t.Run(tc.name, func(t *testing.T) {
			mockRepository := new(mocks.Repository)
			mockHttpClient := new(httpclient.MockHttpClient)
			var cache *bigcache.BigCache

			mockRepository.On("GetMappingClusterBranch", tc.req, mock.Anything).Return(tc.expectedData, tc.mockError)

			usecase := NewUsecase(mockRepository, mockHttpClient, cache)

			resultData, err := usecase.GetMappingClusterBranch(tc.req)

			require.Equal(t, tc.expectedData, resultData)
			if tc.expectedError != nil {
				require.Error(t, err)
				require.EqualError(t, err, tc.expectedError.Error())
			} else {
				require.NoError(t, err)
			}

			mockRepository.AssertExpectations(t)
		})
	}
}

func TestGetMappingClusterChangeLog(t *testing.T) {
	testcases := []struct {
		name          string
		expectedData  []entity.MappingClusterChangeLog
		expectedRow   int
		mockError     error
		expectedError error
	}{
		{
			name:          "error repository",
			mockError:     errors.New("upstream_service_error - Get Mapping Cluster Change Log"),
			expectedError: errors.New("upstream_service_error - Get Mapping Cluster Change Log"),
		},
		{
			name: "success",
			expectedData: []entity.MappingClusterChangeLog{
				{
					ID:         "041b02ab-19b7-4670-8a98-df612a6a93f6",
					DataBefore: `[{"branch_id":"400","customer_status":"AO/RO","bpkb_name_type":1,"cluster":"Cluster C"}]`,
					DataAfter:  `[{"branch_id":"400","customer_status":"AO/RO","bpkb_name_type":1,"cluster":"Cluster A"}]`,
					UserName:   "user",
					CreatedAt:  "2024-02-28 08:04:05",
				},
			},
			expectedRow: 1,
		},
	}

	for _, tc := range testcases {
		t.Run(tc.name, func(t *testing.T) {
			mockRepository := new(mocks.Repository)
			mockHttpClient := new(httpclient.MockHttpClient)
			var cache *bigcache.BigCache

			mockRepository.On("GetMappingClusterChangeLog", mock.Anything).Return(tc.expectedData, tc.expectedRow, tc.mockError)

			usecase := NewUsecase(mockRepository, mockHttpClient, cache)

			resultData, resultRow, err := usecase.GetMappingClusterChangeLog(mock.Anything)

			require.Equal(t, tc.expectedData, resultData)
			require.Equal(t, tc.expectedRow, resultRow)
			if tc.expectedError != nil {
				require.Error(t, err)
				require.EqualError(t, err, tc.expectedError.Error())
			} else {
				require.NoError(t, err)
			}

			mockRepository.AssertExpectations(t)
		})
	}
}
